import React from 'react';

const Navbar = () => {
  return (
    <nav className='navbar bg-dark'>
      <h1>
        <a href='index.html'>
          <i class='fas fa-feather' />
          TelaTale
        </a>
      </h1>
      <ul>
        <li>
          <a href=''>Stories</a>
        </li>
        <li>
          <a href=''>Writers</a>
        </li>
        <li>
          <a href=''>About</a>
        </li>
      </ul>
    </nav>
  );
};
export default Navbar;
